import React from 'react';
import ReactDOM from 'react-dom';
import {BrowserRouter} from 'react-router-dom'

import App from './App';

import Header from './views/header.jsx';

ReactDOM.render(
  <React.Fragment>
    <BrowserRouter>
      <Header />
      <App />
    </BrowserRouter>
  </React.Fragment>,
  document.getElementById('root')
);
